import { Feature } from '../../components';
import './whatGPT3.css';

const WhatGPT3 = () => {
  return (
    <div className='gpt3__whatgpt3 secction__margin' id='whpt3'>
      <div className='gpt3__whatgpt3-feature'>
        <Feature title="What is GPT3"  texte= "Descrição sobre o projeto ou a empresa!" />
      </div>
      <div className='gpt3__whatgpt3-heading'>
        <h1 className='gradient__text'>Possibilidades são ínumeras!</h1>
        <p>Explore as bibliotecas</p>
      </div>
      <div className='gpt3__whatgpt3-container'>
        <Feature title="FUncionalidade1" text="Breve descrição sobre" />
        <Feature title="FUncionalidade2" text="Breve descrição sobre"/>
        <Feature title="FUncionalidade3" text="Breve descrição sobre"/>
      </div>
    </div>
  )
}

export default WhatGPT3
